// get current time and previously saved Time
var currTimestamp = new Date(msg.payload)
var prevTimestamp = new Date(flow.get("prevTimestamp")) || Date.now()

// Save current Time in prevTimestamp flow Variable
flow.set("prevTimestamp", currTimestamp)

// calculate the difference between the timestamps -> time per Revolution
var diff = (currTimestamp.getTime() - prevTimestamp.getTime()) / 1000

// calculate the revolutions per second
// 1 second divided by the time it takes to do one revolution, multiplied by 1 revolution -> rule of three
var revolutionsPerSecond = 1/diff*1

// get rpm from revolutionsPerSecond
var revolutionsPerMinute = revolutionsPerSecond * 60

// Calculate the km/h based on the revolutions per minute and the radius of the wheel in meters
var radiusMM = 50
var velocity = (3/25) * Math.PI * (radiusMM / 1000) * revolutionsPerMinute

// Set payload to velocity in km/h
msg.payload = velocity

// return msg Object
return msg;

